import React from 'react';
import { Card, CardBody, CardTitle, CardText, CardImg, CardSubtitle } from 'reactstrap';
function CharacterCardCreator(props){
    console.log(props);
    const {image, name, species, gender, location, origin} = props;
    return(

        <Card className="mb-3">
          <CardImg width="300px" height="300px" src={image} alt="Card image" />
          <CardBody>
            <CardTitle>{name}</CardTitle>
            <CardSubtitle>{`${species}, ${gender}`}</CardSubtitle>
            <CardText>Last Seen: {location}, First Seen:{origin}</CardText>
          </CardBody>
        </Card>
    )
}

export default CharacterCardCreator;
